import { Link } from "react-router-dom";
import styles from "./NavBar.module.css"

const NavBar = () => {
    return(
    <div className={styles.mainContainer}>
        <Link to="/home">INICIO</Link>
        <link to="/form">NUEVA ACTIVIDAD</link>
    </div>
    )
}

export default NavBar;
